import React, { useEffect } from 'react';

import '../pages/BannerA.scss';
import Navigation from '../components/bannera/Navigation';

function BannerA() {

  useEffect(() => {
      document.title = 'Template - Banner A';
  })

  return (
    <>

    <div className="component-primary-banner">


      <Navigation />



      <div className="banner-display py-5">
        <div className="container">
          <div className="row justify-content-center align-items-center py-5">
            <div className="col-5">
              <img src="/images/iphone-portrait.png" alt="iPhone"/>
            </div>

            <div className="col-5  py-5">
              <h2>Marketplace for</h2>
              <h1 className="my-1">Your deserve more beautiful lists</h1>
              <p className="my-4">Lorem ipsum dolor sit amet consectetur adipisicing elit. Ullam, qui, sit ipsam quo soluta voluptates ratione quam, at magnam deserunt repellat impedit dolores officia cupiditate dolor quae. Harum, alias ullam ex sunt doloremque numquam repudiandae aut, commodi dignissimos similique consequatur.</p>

              <div className="buttons-list row mt-5">
                  <div className="col-12">
                    <button className="bt-download-app mr-3"><img src="/images/bt-google.png" alt=""/></button>
                    <button className="bt-download-app mr-3"><img src="/images/bt-apple.png" alt=""/></button>
                  </div>
              </div>

            </div>
          </div>
        </div>
      </div>



    </div>

    </>
  );
}

export default BannerA;
